import Task from './Task'

const TaskList = ({ tasks = [], onEditTask, onDeleteTask }) => {
  return (
    <ul class="todo-list">
      <Task
        key={id}
        description={description}
        completed={completed}
        created={created}
        onEdit={() => {
          onEditTask(id)
        }}
      />
      {tasks.map(({ id, description, completed, created }) => {
        return (
          <Task
            key={id}
            description={description}
            completed={completed}
            created={created}
            onEdit={() => {
              onEditTask(id)
            }}
          />
        )
      })}
    </ul>
  )
}

export default TaskList;
